	module.exports = {"data":{"markdownRemark":{"html":"<p>Cest un peu une mise en pratique de la politique de <a href=\"#rural_offshore\">rural offshore</a> chre  Marmelab. Non, ce nouveau blog ne sera pas le journal de mon dmnagement, mais ce projet de retour en province me semble un moment propice pour amliorer ma comptence en communication.\n paris, cest trop facile: tous ces meetups, ces confrences, ces collgues de travail... Non pas que je risque de me retrouver seul dans le dsert  Caen, mais pour garder cet esprit de partage parisien, je me prpare sans regret  devoir autant donner que recevoir.\nCommuniquer activement donc, en commenant par ce blog. Et puis crire c'est sans doute <a href=\"#ecrire\">une vraie bonne habitude</a>, mme si ce que lon crit na rien de rvolutionnaire.\nEt au-del du blog, jespre rencontrer rapidement les membres de la <a href=\"http://www.meetup.com/fr-FR/Coding-School-Meetup-Group\">Coding School</a>, de la <a href=\"http://www.meetup.com/fr-FR/Fabrique-de-services-Normandy-Frenchtech/\">fabrique de services</a>, du <a href=\"http://www.forum-digital.fr/\">forum digital</a>, du <a href=\"http://www.club-agile-caen.fr/\">club agile de Caen</a>...</p>\n<h1>Une application pour dmnager</h1>\n<p><strong><em>Road to Caen</em></strong>, cest le nom de mon nouveau side project. Une des premires choses  faire quand on dmnage, cest de penser  un nouvel appartement. Et cest plutt sympa de chercher un appartement en province quand on vient de Paris, on se rend compte quon nest pas oblig de donner un bras pour avoir un logement. Le projet ne va pas consister en une sorte de mashup dannonces immobilires, mais devra aider  trouver la bonne localisation de cet appartement. La qualit de la localisation va dpendre de critres plus ou moins subjectifs, mais cest une des qualits des sides projects: on est toujours dquerre avec le product owner.</p>\n<p>Ces critres seront donc:</p>\n<ul>\n<li><strong>Le collge et lcole de rattachement de ladresse</strong>: jai deux filles. Il nest ici aucunement question de remettre en cause le principe de la carte scolaire et limportance de lcole publique. Il se trouve que ce principe nous a plongs dans des affres de dception, voire de colre sur Paris. Cest donc un point important.</li>\n<li>Ensuite, <strong>la distance  des points notables</strong>, comme la gare (le principe du rural shore, cest aussi dtre rapidement sur Paris), les espaces de coworking, les salles de concert, les marchs, les coles de musique, les bars  baby</li>\n</ul>\n<p>Cette application devra aussi permettre de:</p>\n<ul>\n<li>sauvegarder des adresses</li>\n<li>valuer/noter les adresses (selon leur correspondance aux critres prcdents)</li>\n<li>l'ouvrir  une agence afin vrifier la note de localisation dune ventuelle proposition de location.</li>\n</ul>\n<h1>Planning technique</h1>\n<p>Un side project, cest aussi loccasion de tester des nouvelles techno, ou comme ce sera en partie le cas ici, de faire le point sur celles que lon est sens maitriser. Voici donc les objectifs techniques, plus ou moins pragmatiques:</p>\n<ul>\n<li>Se baser sur de l<strong>open-data</strong>: lide est de mettre en uvre un maximum de donnes normandes, plus ou moins librement et facilement disponibles.</li>\n<li><strong>Serveless</strong>: Je ne suis pas fan du terme, parce quau bout du compte, il y a forcement des serveurs quelque part. Mais ce ne sera pas les miens.</li>\n<li><strong>Mobile first</strong> et <strong>offline</strong>: A priori, lutilisation classique de lapplication sera sur mobile dans le rue en visite dappartement, sans forcment avoir une bonne connexion (cest comment la 4g  Caen?)</li>\n<li><strong>SPA</strong>: jai trouv trs pertinent larticle de <a href=\"#hate_spa\">Stefan Tilkov</a>. Mais connaissant bien lutilisateur final de lapplication, une single page fera trs bien laffaire.</li>\n<li><strong>ES6</strong>: tout le code sera en JavaScript, en profitant au maximum de lES6</li>\n<li><strong>React</strong> et <strong>Redux</strong> (ou pas): je trouve intressantes toutes les discussions actuelles sur la <a href=\"https://medium.com/search?q=javascript%20fatigue\">fatigue javascript</a> Alors, faire du React/Redux pour faire du React/Redux? Oui, un peu, ne serait-ce que parce que cela correspond au bootstrap actuel des projets <a href=\"http://marmelab.com/\">Marmelab</a>. Mais ce sera peut-tre loccasion dy trouver une non-pertinence.</li>\n<li>Il faudra persister des donnes (sauvegarde dadresses, points favoris), synchroniser ces donnes entre plusieurs devices, et que cela puisse se faire offline. Je pense donc tester quelques services du genre de <a href=\"https://www.firebase.com\">Firebase</a>, <a href=\"http://pouchdb.com/\">pouchdb</a> ou <a href=\"http://aws.amazon.com/fr/cognito/\">Amazon Cognito</a>.</li>\n</ul>\n<h1>Road to Caen</h1>\n<p>Pour finir ce post, pourquoi Road de Caen? Et bien en rfrence au <strong>Road to Rouen</strong> de <em>Supergrass</em>.</p>\n<center><iframe src=\"https://embed.spotify.com/?uri=spotify:album:7HBzTTfJhW9sis8yvgxmL6&view=coverart\" width=\"300\" height=\"380\" frameborder=\"0\" allowtransparency=\"true\"></iframe></center>\n<p>Il se trouve que je pense que tous les Normands dansent sur de la pop anglaise (ma femme est de Saint-L). Je suis pour ma part manceau, et si par malheurs nous avions dmnag au Mans, je laurais appel <a href=\"https://open.spotify.com/album/2bU6BaHfovn3rvxxxHSkWd\"><strong><em>The arguments for Le Mans</em></strong></a> ou <a href=\"https://open.spotify.com/album/2eOu9QDLP2MoO04ZtII2Vm\"><strong><em>New Day Rising In Le Mans</em></strong></a>.</p>\n<p>Dans mon prochain post, jaborderais le bootstrap du projet, et la mise en place du MVP: les collges lis  une adresse  Caen.</p>\n<h1>Rfrences</h1>\n<ul>\n<li><a name=\"rural_offshore\"></a><a href=\"http://marmelab.com/blog/2015/06/11/iteration-agile.html\">L'itration agile : entre SSII et agence, un nouveau mode de prestation informatique</a></li>\n<li><a name=\"ecrire\"></a><a href=\"http://alistapart.com/column/write-what-you-know-now\">Write What You Know (Now)</a></li>\n<li><a name=\"hate_spa\"></a><a href=\"https://medium.com/@stilkov/why-i-hate-your-single-page-app-f08bb4ff9134#.bzfye46vx\">Why I hate your Single Page App</a></li>\n</ul>","frontmatter":{"title":"Road to Caen","date":"2016-01-25","tags":["Lean"],"description":"Un nouveau blog, un premier post et un titre pas trs technique: je dmnage cet t  Caen. "}}},"pathContext":{"slug":"road_to_caen_le_projet"}}

