	module.exports = {"data":{"markdownRemark":{"html":"<p>Dans mon cas, cest parce que lenvironnement de travail du client ne pouvait tre autre chose quun Windows7 sur un VM (avec des droits dadministrateur tout de mme), le tout derrire un firewall peu conciliant. La mission prvoyait un back en PHP 5.6 avec du Silex, et un peu de JavaScript sur la partie front.</p>\n<h1>Pourquoi a-t-il fallu trouver une autre solution que les installateurs Windows</h1>\n<p>En tout premier lieu, j'ai install Atom, par habitude, mme si je ne l'ai pas encore utilis pour du dveloppement PHP.\nHormis un petit souci initial (pour installer Atom, jai eu besoin d'une version 4.5 de .net et de l'espace disque allant avec), linstallation officielle se passe bien.\nDans le cas ou l'on est derrire un Firewall, il faut juste penser  diter ou  ajouter le fichier<code>.atom/.apmrc</code> si l'on veut installer quelques plug-ins (atom-beautify, linter, linter-php,).</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\"># $HOME/.atom/.apmrc\n\nhttp-proxy = \"http://LOGIN:PASSWORD@PROXY_URL:PROXY_PORT\"\nhttps-proxy = \"http://LOGIN:PASSWORD@PROXY_URL:PROXY_PORT\"\nproxy = \"http://LOGIN:PASSWORD@PROXY_URL:PROXY_PORT\"</code></pre>\n      </div>\n<p>Je suis ensuite pass  lenvironnement PHP. Ma vm tait livre avec un Xampp dorigine. Aprs avoir ajout la Path, jai bien accs  PHP depuis le terminal, pardon, <strong>l'invite de commande</strong>.</p>\n<p><img src=\"/images/windevPhpPath.png\" alt=\"Add Php to your path\"></p>\n<p>C'tait donc confiant que je lanais l'installateur de <strong>Composer</strong>. Trop confiant peut-tre.</p>\n<p><img src=\"/images/erroComposerInstallExe_1.PNG\" alt=\"Composer windows installer\"></p>\n<p>Je suis donc pass par l'invite de commande, mais sans obtenir de meilleurs rsultats:</p>\n<p><img src=\"/images/composeurInvitCommande.PNG\" alt=\"Composer install from cli\"></p>\n<p>Je dcidais de repousser  plus tard cette question de <strong>Composer</strong> pour me lancer dans l'installation de Git. Suivant mon ide initiale, je commenais par lutilitaire officiel Github. Si linstallation elle-mme fut sans problme, impossible ensuite de se connecter  Github. Ceci tait sans aucun doute d au Firewall.</p>\n<p>Bref, la matine commenait plutt mal, et les bonnes vannes sur Windows me revenaient en tte au galop.</p>\n<h1>Babun</h1>\n<p>Il me semblait pourtant me rappeler d'une possible solution  mon problme, une promesse de console sous Windows que j'avais d noter quelque part... Grce  <a href=\"https://raindrop.io\">Raindrop</a>, j'ai retrouv ce projet: <a href=\"http://babun.github.io/\">Babun</a>.</p>\n<p>Voici la description officielle du projet : \"<em>Would you like to use a linux-like console on a Windows host without a lot of fuzz? Try out babun!</em>\".</p>\n<p>Une fois l'installation termine sans problme, je lanais un premier test <code>badun check</code>, me rappelant que j'tais derrire un firewall.</p>\n<p><img src=\"/images/babunCheckFirewall.PNG\" alt=\"Babun check fail\"></p>\n<p>Il a donc juste fallu configurer le proxy dans le fichier <code>~/.babunrc</code> pour que tout semble fonctionner.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\">export http_proxy=http://LOGIN:PASSWORD@PROXY_URL:PROXY_PORT\nexport https_proxy=$http_proxy\nexport ftp_proxy=$http_proxy\nexport no_proxy=localhost</code></pre>\n      </div>\n<p><img src=\"/images/babunCheckFirewallPROXY.PNG\" alt=\"Babun check success\"></p>\n<p>J'enchainais donc avec l'installation de PHP grce au gestionnaire de package de Babun <strong>Pact</strong> (et  l'ajout d'un fichier ~/.wgetrc pour dclarer le proxy pour la commande <code>wget</code> parfois utilise par Pact), puis Composer, le tout sans erreur. Reconnaissant envers <a href=\"https://twitter.com/tombujok\">Tomek Bujok</a>, j'avais un environnement PHP fonctionnelet une console dj bien configure (git, zsh, ...). J'ai mme rcupr quelques .dotfile (qu'il ne faut pas oubli de convertir en ISO 8859-1), install <strong>tmux</strong>, et j'avais presque l'impression d'tre sur mon Mac.</p>\n<p> <img src=\"/images/tmuxMakeServer.PNG\" alt=\"Composer installer\"></p>\n<h1>Oui, mais</h1>\n<p>Il tait enfin temps de se mettre eu travail : je lanais un <code>composer requier silex</code>, et l, <em>badabun</em> :</p>\n<p> <img src=\"/images/fuckedBabun.PNG\" alt=\"Composer installer\"></p>\n<p>Je passe les dtails des recherches effectues sur ce qui tait un nouveau type d'erreur dans ma vie de dveloppeur PHP, mais la conclusion en fut que le problme provenait de la version de Cygwin utilise par Babun : la version 32 bits sur mon Windows 64 bits sur lequel tait install Symantec Endpoint Protection en 64 bits ... Qu' cela ne tienne, il suffisait de passer le Cygwin en 64 bit. Sauf que cette version n'est pas, et ne sera  priori pas, support par Babun.</p>\n<p>Ne me restait plus qu'une solution logique : se passer de Babun, et n'utiliser que le <a href=\"https://www.cygwin.com/\">Cygwin</a>. Et ce fut effectivement la bonne solution. Babun n'est au final qu'une surcouche de configuration et d'utilitaires au-dessus de Cygwin, qui lui ne dispose ni d'un gestionnaire de package (il faut repasser par l'installateur Windows si on a oubli quelque chose), ni d'une configuration simplifie du proxy, et qui n'est pas directement livr avec zsh, oh-my-zsh, git, etc ...\nAu final, et avec un peu de temps, j'ai install un environnement PHP et un composer global cette fois-ci fonctionnels, git, zsh, tmux, ...</p>\n<p> <img src=\"/images/finalCygwin.PNG\" alt=\"Composer installer\"></p>\n<h1>Pour finir</h1>\n<p>Rien de bien rvolutionnaire dans ce post de blog: Cygwin est un projet dj ancien. Mais c'est sans aucun doute un outil  connaitre, que l'on soit habituellement sous Windows ou pas. Le projet Babun est aussi intressant, et acclre grandement l'installation d'une console complte ... tant que la version de Cygwin 32 n'est pas un problme.</p>\n<p>Mais quel rapport a donc tout cela avec le snobisme ? Et bien, il se trouve que c'est une question (il s'agissait d'ailleurs plus d'une affirmation) qui m'a t pose lors de ma qute vers une console fonctionnelle. La rponse vidente tait que sans Cygwin, je ne pouvais pas installer Composer. Alors certes oui, j'aurais pu installer les librairies Silex et autres dpendance  la main. Mais on est en 2016, et je ne suis pas certain que mon tarif horaire soit suffisamment bas pour se lancer dans une telle perte de temps. Et plus important, j'ai mieux  faire.</p>\n<p>Mais j'aimerais pour terminer ce post donner une encore bien meilleure rponse, lue  la fin du chapitre <strong>Orthogonality</strong> du livre <strong>The Pragmatic Programmer</strong> de <strong>Andrew Hunt et David Thomas</strong> :</p>\n<blockquote>\n<p>Challenges : \" Consider the difference between large GUI-oriented tools typically found on Windows systems and small but combinable command line utilities used at shell prompts. Which set is more orthogonal, and why? Which set is easier to combine with other tools to meet new challenges ? \"</p>\n</blockquote>","frontmatter":{"title":"Est-ce du snobisme que de vouloir une vraie console sous Windows ?","date":"2016-02-01","tags":["dev","daily tools"],"description":"Il arrive parfois que lon doive coder sous Windows: que ce soit par challenge, parce que lon a perdu un pari ou parce quon na pas le choix. Et cela peut tre un peu douloureux lorsque lon est habitu  sa console Mac ou Linux."}}},"pathContext":{"slug":"une_console_sous_windows"}}

