	module.exports = {"data":{"markdownRemark":{"html":"<h1>Hbergement du site sur S3</h1>\n<p>Lun des objectifs du projet est de raliser une application <strong>serverless</strong>. Pour <strong><em>Road to Caen</em></strong>, ce ne devrait pour linstant pas tre compliqu, lapplication ne consistant quen une application JavaScript. Il suffira donc dhberger les fichiers statiques sur un BucketS3, configur pour pouvoir servir ses fichiers en HTTP.</p>\n<p>La manipulation est trs simple, et <a href=\"http://docs.aws.amazon.com/fr_fr/AmazonS3/latest/dev/WebsiteHosting.html\">la documentation</a> permet de rapidement mettre en place notre infrastructure</p>\n<p>Je vais juste revenir sur les points qui me semblent les plus importants.</p>\n<h3>- Nommage du bucket</h3>\n<p>Il faut donner le mme nom au bucket que lurl du site. Par exemple pour une url <strong>mon<em>site. mon</em>domaine.com</strong>, on nommera le bucket... <strong>mon<em>site. mon</em>domaine.com</strong></p>\n<h3>- Cration d'un utilisateur IAM, et d'une <em>Policies</em> spcifique pour le bucket</h3>\n<p>Ensuite, il est <strong>obligatoire</strong> de crer un utilisateur IAM pour interagir avec notre bucket, afin dtre certain de ne jamais utiliser <strong>laws<em>access</em>key_id</strong> et <strong>laws<em>secret</em>access_key</strong> de lutilisateur principal du compte AWS (le root en quelque sorte). Certains sen sont mordu les doigts.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\"># Policies applique au user IAM\n {\n    \"Version\": \"2012-10-17\",\n    \"Statement\": [\n        {\n            \"Sid\": \"Stmt1453976839000\",\n            \"Effect\": \"Allow\",\n            \"Action\": [\n                \"s3:PutObject\",\n                \"s3:PutObjectAcl\",\n                \"s3:DeleteObject\",\n                \"s3:AddObject\"\n            ],\n            \"Resource\": [\n                \"arn:aws:s3:::mon_site.mon_domaine.com/*\"\n            ]\n        }\n    ]\n}</code></pre>\n      </div>\n<h3>- Ajout d'une entre CNAM au DNS de son domaine</h3>\n<p>Il faut ajouter une entre CNAM dans les rglages DNS de son domaine.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\">mon_site CNAME mon_site.mon_domaine.com.s3-website-eu-west-1.amazonaws.com.</code></pre>\n      </div>\n<h1>Dploiement manuel</h1>\n<p>Avant de configurer le dploiement automatique, on va tout de mme configurer de quoi dployer <em> la main</em> notre code sur S3.\nPour cela, il faut tout d'abord installer <a href=\"https://aws.amazon.com/fr/cli/\">awscli</a>. Sur un Mac, on peut utiliser <a href=\"http://brew.sh/\">brew</a> :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-bash\"><code class=\"language-bash\">brew <span class=\"token function\">install</span> awscli\n</code></pre>\n      </div>\n<p>Ensuite, on configure un profil spcifique au projet, avec les identifiants de l'utilisateur IAM prcdemment cr :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\"># ~/.aws/config\n\n[default]\noutput = json\nregion = us-east-1\n\n[profile IAM_USER_PROFIL]\noutput = json\nregion = eu-west-1\naws_access_key_id = IAM_USER_ACCESS_KEY_ID\naws_secret_access_key = IAM_USER_SECRET_ACCESS_KEY</code></pre>\n      </div>\n<p>Ne reste plus qu' ajouter une nouvelle commande  notre fichier <code>makefile</code>:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-makefile\"><code class=\"language-makefile\"><span class=\"token comment\"># makefile</span>\n\n<span class=\"token symbol\">deploy</span><span class=\"token punctuation\">:</span> build\n    <span class=\"token operator\">@</span> echo <span class=\"token string\">'* Deploy web app on S3 *'</span>\n    aws s3 --profile<span class=\"token operator\">=</span>IAM_USER_PROFIL --region<span class=\"token operator\">=</span>eu-west-1 sync ./build/ s3<span class=\"token punctuation\">:</span>//YOUR-BUCKET-NAME/ --delete\n</code></pre>\n      </div>\n<h1>Worflow de dveloppement et intgration continue</h1>\n<p>Le worflow de dveloppement sera trs simple; c'est d'ailleurs celui que je trouve le meilleur, mme sur les projets plus importants :</p>\n<ul>\n<li>une branche master qui contient le code envoy sur S3,</li>\n<li>une nouvelle branche par feature dveloppe.</li>\n</ul>\n<p>Une fois la feature termine, elle est intgre  la branche master via une pull request. C'est  ce moment que l'on va parler d'intgration continue, car cette PR va tre automatiquement teste sur <a href=\"https://travis-ci.org\"><strong>Travis</strong></a>. Il suffit pour cela d'ajouter le fichier <code>.travis.yml</code>  la racine du projet :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-yaml\"><code class=\"language-yaml\"><span class=\"token comment\"># .travis.yml</span>\n\n<span class=\"token key atrule\">language</span><span class=\"token punctuation\">:</span> node_js\n\n<span class=\"token key atrule\">node_js</span><span class=\"token punctuation\">:</span>\n    <span class=\"token punctuation\">-</span> <span class=\"token string\">\"5.5\"</span>\n\n<span class=\"token key atrule\">env</span><span class=\"token punctuation\">:</span>\n    <span class=\"token punctuation\">-</span> CXX=g++<span class=\"token punctuation\">-</span><span class=\"token number\">4.8</span>\n\n<span class=\"token key atrule\">sudo</span><span class=\"token punctuation\">:</span> <span class=\"token boolean important\">true</span>\n\n<span class=\"token key atrule\">addons</span><span class=\"token punctuation\">:</span>\n    <span class=\"token key atrule\">apt</span><span class=\"token punctuation\">:</span>\n        <span class=\"token key atrule\">sources</span><span class=\"token punctuation\">:</span>\n            <span class=\"token punctuation\">-</span> ubuntu<span class=\"token punctuation\">-</span>toolchain<span class=\"token punctuation\">-</span>r<span class=\"token punctuation\">-</span>test\n        <span class=\"token key atrule\">packages</span><span class=\"token punctuation\">:</span>\n            <span class=\"token punctuation\">-</span> gcc<span class=\"token punctuation\">-</span><span class=\"token number\">4.8</span>\n            <span class=\"token punctuation\">-</span> g++<span class=\"token punctuation\">-</span><span class=\"token number\">4.8</span>\n\n<span class=\"token key atrule\">cache</span><span class=\"token punctuation\">:</span>\n    <span class=\"token key atrule\">directories</span><span class=\"token punctuation\">:</span>\n        <span class=\"token punctuation\">-</span> node_modules\n\n<span class=\"token key atrule\">before_script</span><span class=\"token punctuation\">:</span>\n    <span class=\"token punctuation\">-</span> cp <span class=\"token punctuation\">-</span>n ./config/test.js.dist ./config/test.js <span class=\"token punctuation\">|</span> true\n\n<span class=\"token comment\"># xvfb va permettre de lancer firefox, utilis pour les tests fonctionnels</span>\n<span class=\"token comment\"># sans avoir  installer un serveur X</span>\n<span class=\"token key atrule\">before_install</span><span class=\"token punctuation\">:</span>\n    <span class=\"token punctuation\">-</span> <span class=\"token string\">\"export DISPLAY=:99.0\"</span>\n    <span class=\"token punctuation\">-</span> <span class=\"token string\">\"sh -e /etc/init.d/xvfb start\"</span>\n\n<span class=\"token key atrule\">install</span><span class=\"token punctuation\">:</span>\n    <span class=\"token punctuation\">-</span> <span class=\"token string\">\"make --silent install\"</span>\n</code></pre>\n      </div>\n<p>Pour un projet en node, Travis va lancer le script de test dclar dans le <code>package.json</code>:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-json\"><code class=\"language-json\"><span class=\"token property\">\"scripts\"</span><span class=\"token operator\">:</span> <span class=\"token punctuation\">{</span>\n  <span class=\"token property\">\"test\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"make test\"</span>\n<span class=\"token punctuation\">}</span><span class=\"token punctuation\">,</span>\n</code></pre>\n      </div>\n<p>Il faut videmment dclarer le dpt git du projet sur le site de Travis, pour qu'il puisse mettre en place les webhooks lui permettant de savoir quand une PR est ralise. Travis est gratuit pour les dpts publics.</p>\n<h1>Dploiement continu</h1>\n<p>Pour finir, on va automatiser le dploiement du code sur notre Bucket S3, lorsque la PR  (passe <em>au vert</em> sur Travis) est merge sur la branche <strong>master</strong>. Pour cela, j'utilise <a href=\"https://snap-ci.com\"><strong>Snap CI</strong></a> (mais il en existe d'autres), qui est tout comme Travis gratuit pour les dpts git public. L'interface est bien ralise, et permet de monter un <strong><em>pipeline</em></strong> d'tapes, dont une ralisant le dploiement sur S3. Une tape peut galement consiste  lancer les tests une dernire fois avant de dployer, au cas o ...</p>\n<p><img src=\"/images/rtc_deployment/snapCiRTC.png\" alt=\"Road to Caen Pipeline\"></p>\n<h1>C'est prt !</h1>\n<p>Et voil, on peut commencer  coder en ES6 sur une <strong>nouvelle branche</strong>. Une fois une feature termine et <strong>teste</strong>, on propose le code via une <strong>PR sur Github</strong>. Si les tests passent tous sur <strong>Travis</strong>, on <strong>merge</strong> la PR, et <strong><em>tadam</em></strong>, le code est directement envoy sur <strong>S3</strong> grce  <strong>Snap CI</strong> et accessible  la terre entire.</p>","frontmatter":{"title":"Dploiement continu vers S3","date":"2016-02-15","tags":["AWS","S3","Devops"],"description":"Lapplication Road to Caen est maintenant bootstrappe. Avant de commencer le dveloppement proprement, il reste  mettre en place le tunnel de dploiement continu, du code cr en local au bucketS3 dhbergement, dploiement scuris par lexcution automatique des tests unitaires et fonctionnels dj mis en place."}}},"pathContext":{"slug":"deploiement-continu-vers-s3"}}

