	module.exports = {"data":{"markdownRemark":{"html":"<p><code>npm</code> n'est sans doute pas l'outil le plus handicapant de la stack javascript. C'est mme franchement bien. Mais, c'est vrai, c'est parfois lent,\nparfois surprenant dans un worflow d'intgration continue, et le <code>npm shrinkwrap</code> est parfois plus source de problmes que de solutions. Ce que promet <a href=\"https://yarnpkg.com/\">Yarn</a>: de la rapidit et une bonne gestion des versions des modules.</p>\n<h2>Premier test en local</h2>\n<p> Yarn s'installe trs simplement avec ... <code>npm</code>:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\">npm i -g yarn</code></pre>\n      </div>\n<p>Je vais tester sur un projet ayant beaucoup (trop ;) ) de dpendances: le <a href=\"https://github.com/marmelab/javascript-boilerplate\">boilereplate javascript</a> de Marmelab.\nPour une premire installation, aprs clonage du repo, voil le comparatif:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\">npm: 1min 30s\nyarn: 1min 17s</code></pre>\n      </div>\n<p>  Rien de trs fulgurant. Le projet n'avait pas de fichier <code>npm-shrinkwrap.json</code>, ni de fait de <code>yarn.lock</code>.\nAprs avoir supprimer le rpertoire <code>node_modules</code>, je relance une installation. Maintenant, le rsultat est beaucoup plus probant.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\">npm: 1min 11s\nyarn: 15s</code></pre>\n      </div>\n<p>Effectivement, une fois le cache chauff, Yarn est vraiment plus rapide</p>\n<h2>Yarn dans un docker</h2>\n<p>Si npm est un peu lent, c'est rarement un problme en cours de dveloppement en local. Par contre, cela peut tre plus problmatique pour les builds et les tests sur un serveur d'intgration continue.\nJe conseille donc l'article de Martino Fornasa, <a href=\"https://hackernoon.com/using-yarn-with-docker-c116ad289d56#.rz7m1fh58\">Using Yarn with Docker</a></p>\n<h2>Conclusion</h2>\n<p>Il s'agit d'un test trs rapide, mais en partie concluant. Je ne pense pas utiliser Yarn sur des projets clients pour le moment.\nMais comme outil quotidien pour des tests ou des projets perso, oui, srement. Je ne suis pas fan de l'ide que Facebook soit en train de truster tellement d'outils js.\nEt qui sait, cela mettra j'espre un coup de fouet  l'quipe de npm pour que la v4 revienne avec un gain de performance consquent.</p>\n<h3>Note</h3>\n<p><a href=\"https://shift.infinite.red/npm-vs-yarn-cheat-sheet-8755b092e5cc#.8dakk7y15\">une cheat-sheet yarn vs npm</a></p>","frontmatter":{"title":"Yarn","date":"2016-11-02","tags":["javascript","module","npm","tool"],"description":"Parfois, les outils javascript semblent tre des effets de mode. Mais devant le nombre de retours positifs sur projet Yarn, cela doit quand mme valoir le coup d'y jeter un coup dil."}}},"pathContext":{"slug":"yarn"}}

