	module.exports = {"data":{"markdownRemark":{"html":"<p>Gatsby est un systme de gnration de site statique bas sur Node. En mode dveloppement, il s'appuie sur le <code>webpack dev server</code> afin de se mettre  jours automatiquement.</p>\n<p>Nous avons donc besoin d'une image docker permettant de lancer une commande node :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-yaml\"><code class=\"language-yaml\">// in docker<span class=\"token punctuation\">-</span>compose.yml\n<span class=\"token key atrule\">version</span><span class=\"token punctuation\">:</span> <span class=\"token string\">'3'</span>\n<span class=\"token key atrule\">services</span><span class=\"token punctuation\">:</span>\n  <span class=\"token key atrule\">gatsby</span><span class=\"token punctuation\">:</span>\n    <span class=\"token key atrule\">image</span><span class=\"token punctuation\">:</span> node<span class=\"token punctuation\">:</span>8<span class=\"token punctuation\">-</span>alpine\n    <span class=\"token key atrule\">volumes</span><span class=\"token punctuation\">:</span>\n      <span class=\"token punctuation\">-</span> .<span class=\"token punctuation\">:</span>/app\n    <span class=\"token key atrule\">working_dir</span><span class=\"token punctuation\">:</span> /app\n    <span class=\"token key atrule\">ports</span><span class=\"token punctuation\">:</span>\n      <span class=\"token punctuation\">-</span> 8000<span class=\"token punctuation\">:</span><span class=\"token number\">8000</span>\n    <span class=\"token key atrule\">command</span><span class=\"token punctuation\">:</span> npm run develop\n</code></pre>\n      </div>\n<p>On va ensuite faciliter la vie des contributeurs avec un makefile</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-make\"><code class=\"language-make\">// in makefile\n.PHONY: build help\n\nhelp:\n\t@grep -E '^[a-zA-Z0-9_-]+:.*?## .*$$' $(MAKEFILE_LIST) | sort | awk 'BEGIN {FS = \":.*?## \"}; {printf \"\\033[36m%-30s\\033[0m %s\\n\", $$1, $$2}'\n\ninstall: ## install dependencies with docker\n\t@docker-compose run --rm gatsby npm install\n\nstart: ## run gatsby in develop mode with docker\n\t@docker-compose up -d\n\nstop: ## stop gatsby in docker\n\t@docker-compose down\n\nlogs: ## Display logs from docker\n\t@docker-compose logs\n\nbuild: ## build site with docker\n\t@docker-compose run --rm gatsby npm run build</code></pre>\n      </div>\n<p>Ne reste donc plus qu' lancer un <code>make start</code>. Mais l :</p>\n<p><img src=\"/images/siteInaccessible.png\" alt=\"Site inaccessible\"></p>\n<p>En effet, le <code>webpack dev server</code> gre trs mal le localhost au sein du docker. Il faut donc modifier un peu la commande <code>develop</code> dans le <code>package.json</code> en ajoutant <code>--host 0.0.0.0</code> pour que webpack accepte toutes les requtes:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-json\"><code class=\"language-json\">    <span class=\"token property\">\"scripts\"</span><span class=\"token operator\">:</span> <span class=\"token punctuation\">{</span>\n        <span class=\"token property\">\"develop\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"gatsby develop --host 0.0.0.0\"</span><span class=\"token punctuation\">,</span>\n        <span class=\"token property\">\"build\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"gatsby build\"</span><span class=\"token punctuation\">,</span>\n        <span class=\"token property\">\"serve\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"gatsby serve\"</span><span class=\"token punctuation\">,</span>\n    <span class=\"token punctuation\">}</span><span class=\"token punctuation\">,</span>\n</code></pre>\n      </div>\n<p>Et voil.</p>","frontmatter":{"title":"Dvelopper un site Gasby.js avec Docker","date":"2017-11-06","tags":["Gatsby","Docker"],"description":"En ce moment, j'utilise Gasby pour plusieurs sites (ce blog compris). Mais tous les contributeurs de ces sites ne veulent pas forcment installer Node sur leur machine. La solution vidente : Docker."}}},"pathContext":{"slug":"gasby-avec-docker"}}

