	module.exports = {"data":{"markdownRemark":{"html":"<p>Si le terme <strong><em>monorepo</em></strong> fait trs technique, il traduit parfaitement un concept simplissime: utiliser un seul repository pour plusieurs projets.</p>\n<p>Jai vu passer pas mal de posts de blog ces derniers temps sur le sujet, provenant le plus souvent de grosses boites ayant dinnombrables projets et dinnombrables dveloppeurs, et donc dinnombrables dpts de code. Le passage en monorepo pour ce type denvironnement est certainement trs intressant, mais trs loign de mon quotidien.</p>\n<p>Mais le principe de cette approche nest pas une dcouverte: on utilise (chez Marmelab) depuis longtemps un unique repository pour grer toutes les parties dun mme projet (une api back, une application cliente, une appli dadministration ...).</p>\n<p>Cest en participant  la nouvelle version dadmin-on-rest, renomme <a href=\"\">react-admin</a> que jai dcouvert de nouveaux outils ddis aux monorepos. </p>\n<h2>Le cas d'un projet de librairie (JavaScript)</h2>\n<p>Dans le cadre dun projet librairie, on essaye de dcouper le code en plusieurs petites parties pour en faciliter lutilisation, par exemple en vitant  lutilisateur final de charger une librairie norme dont il nutiliserait que quelques fonctionnalits. Mais qui dit plusieurs parties dit beaucoup dinterdpendance entre chaque partie (et lenfer du <code>npm link</code>) et plusieurs packages  distribuer (plusieurs repo? :) ). </p>\n<p>Sont donc apparus dans le monde du JavaScript des outils comme les <a href=\"https://yarnpkg.com/en/docs/workspaces\">workspaces Yarn</a> ou le projet <a href=\"https://lernajs.io/\">Lerna</a>.<br>\nS'ils sont dun indniable intrt pour les projets de type librairie, peuvent-ils apporter quelque chose au quotidien de projets plus classiques orients client?</p>\n<h2>C'est quoi un \"projet plus classique orient client\" ?</h2>\n<p>C'est pour ma part un projet qui va requrir : </p>\n<ul>\n<li>une api,</li>\n<li>une interface d'administration,</li>\n<li>une application (web et/ou mobile) publique.</li>\n</ul>\n<p>En en ce moment, tout est en JavaScript. Ce qui donne peu ou prou :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-bash\"><code class=\"language-bash\"><span class=\"token keyword\">.</span>\n public\n    admin\n    api\n    client\n src\n    admin\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    node_modules\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    package.json\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    index.js\n    api\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    node_modules\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    package.json\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    index.js\n    client\n<span class=\"token operator\">|</span>        node_modules\n<span class=\"token operator\">|</span>        package.json\n<span class=\"token operator\">|</span>        index.js\n .gitignore\n README.md\n makefile\n</code></pre>\n      </div>\n<p>On a un rpertoire <code>public</code> pour les builds finaux, un rpertoire <code>src</code> dans lequel on retrouve les trois \"projets\", chacun grant ses dpendances (parfois les mmes). Un <code>makefile</code>  la racine permet de lancer par exemple l'installation des dpendances des trois projets.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-makefile\"><code class=\"language-makefile\">// in makefile\n\n<span class=\"token symbol\">install-admin</span><span class=\"token punctuation\">:</span>\n\tcd src/admin &amp;&amp; yarn install\n\n<span class=\"token symbol\">install-api</span><span class=\"token punctuation\">:</span>\n\tcd src/api &amp;&amp; yarn install\n\n<span class=\"token symbol\">install-client</span><span class=\"token punctuation\">:</span>\n\tcd src/client &amp;&amp; yarn install\n\n<span class=\"token symbol\">install</span><span class=\"token punctuation\">:</span> install-admin install-api install-client\n</code></pre>\n      </div>\n<br />\n<blockquote>\n<p>Du coup, les outils dvelopps pour une approche monorepo peuvent-ils amliorer cette manire d'organiser mon code ?</p>\n</blockquote>\n<h2>Yarn workspace</h2>\n<p>Les workspaces yarn sont disponibles depuis la version <code>1.0</code>. L'utilisation de ces workspaces va permettre de dclarer un <code>package.json</code> <em>parent</em> dans lequel on va indiquer  yarn o sont nos <code>package.json</code> <em>enfants</em> (ceux de nos trois projets). Yarn pourra ainsi se dbrouiller depuis la racine du projet pour installer toutes les dpendances, et surtout mettre toutes celles communes dans un mme rpertoire node_modules  la racine du projet: c'est de l'espace disque et du temps d'installation de gagns.</p>\n<p>Voici  quoi ressemble le package.json  la racine du site :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-json\"><code class=\"language-json\"><span class=\"token punctuation\">{</span>\n    <span class=\"token property\">\"private\"</span><span class=\"token operator\">:</span> <span class=\"token boolean\">true</span><span class=\"token punctuation\">,</span>\n    <span class=\"token property\">\"workspaces\"</span><span class=\"token operator\">:</span> <span class=\"token punctuation\">[</span>\n        <span class=\"token string\">\"src/*\"</span>\n    <span class=\"token punctuation\">]</span>\n<span class=\"token punctuation\">}</span>\n</code></pre>\n      </div>\n<p><strong>Les autres fichiers package.json n'ont pas  tre modifis.</strong></p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-bash\"><code class=\"language-bash\"><span class=\"token keyword\">.</span>\n node_modules\n public\n    admin\n    api\n    client\n src\n    admin\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    node_modules\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    package.json\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    index.js\n    api\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    node_modules\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    package.json\n<span class=\"token operator\">|</span>   <span class=\"token operator\">|</span>    index.js\n    client\n<span class=\"token operator\">|</span>        node_modules\n<span class=\"token operator\">|</span>        package.json\n<span class=\"token operator\">|</span>        index.js\n .gitignore\n package.json\n README.md\n makefile\n</code></pre>\n      </div>\n<p>Pour reprendre mon exemple prcdent, l'installation du projet global prenait 333 Mo sur le disque. </p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-bash\"><code class=\"language-bash\">~/Code/sideprojects\n <span class=\"token function\">du</span> -hs seamanship\n333M    seamanship\n</code></pre>\n      </div>\n<p>Avec la mise en place des workspaces, le projet global ne prend plus que 186 Mo.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-bash\"><code class=\"language-bash\">~/Code/sideprojects\n <span class=\"token function\">du</span> -hs seamanship\n186M    seamanship\n</code></pre>\n      </div>\n<p><strong><em>Remarque</em></strong>: <em>lors de mes tests, les parties <code>admin</code> et <code>client</code> taient bootstrappes avec <code>create-react-app</code>. Il a donc fallu que je cre mes deux rpertoires avec un <code>create-react-app admin</code> et <code>create-react-app client</code> depuis <code>src</code>, ensuite que je supprime le <code>yarn.lock</code> et le rpertoire <code>node_modules</code> des deux parties, pour enfin relancer un <code>yarn install</code> depuis la racine du projet afin de profiter des workspaces.</em></p>\n<p><strong><em>Tips</em></strong>: <em>Pour installer un nouveau composant dans un des workspaces, on peut lancer un <code>yarn add</code> depuis le rpertoire du workspace, ou alors plus pratique, depuis la racine du projet :</em></p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code class=\"language-none\">yarn workspace workspaceNameInPackageJson add componantName</code></pre>\n      </div>\n<h2>Code styling</h2>\n<p>Les workspace permettent de facilement mutualiser les dpendances entre les diffrentes parties d'un projet. Mais peut-on les utiliser pour grer d'autres problmatiques communes, comme la gestion du code styling ? </p>\n<p>Essayons d'installer eslint  la racine du projet :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-bash\"><code class=\"language-bash\">~/Code/sideprojects/seamanship master*\n yarn add eslint\nyarn add v1.3.2\nerror Running this <span class=\"token function\">command</span> will add the dependency to the workspace root rather than workspa\nce itself, <span class=\"token function\">which</span> might not be what you want - <span class=\"token keyword\">if</span> you really meant it, <span class=\"token function\">make</span> it explicit by ru\nnning this <span class=\"token function\">command</span> again with the -W flag <span class=\"token punctuation\">(</span>or --ignore-workspace-root-check<span class=\"token punctuation\">)</span>.\ninfo Visit https://yarnpkg.com/en/docs/cli/add <span class=\"token keyword\">for</span> documentation about this command.\n</code></pre>\n      </div>\n<p>Comme c'est vraiment ce que l'on veut, lanons donc :</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-bash\"><code class=\"language-bash\">yarn add -DW eslint prettier eslint-plugin-prettier eslint-config-prettier\n</code></pre>\n      </div>\n<p>Et tout se droule normalement \\o/.</p>\n<h2>Les tests</h2>\n<p>Il reste encore une problmatique  aborder dans cette rapide exploration des outils lis aux monorepos : peut-on simplifier le lancement de l'intgralit des <strong>tests</strong> du projet ?     </p>\n<p>Depuis sa version 20, Jest est capable de <a href=\"https://facebook.github.io/jest/docs/en/configuration.html#projects-array-string-projectconfig\">lancer en parallle les tests sur plusieurs projets</a> :</p>\n<p><img src=\"/images/monorepo/20-multi-runner.gif\" alt=\"Jest Multi-Project-Runner\"></p>\n<p>Pas de chance pour mon exploration qui se base sur deux applications <em>create-react-app</em>, <a href=\"https://github.com/facebook/create-react-app/issues/2461\">elles ne sont pas compatible avec cette fonctionnalit</a> :( </p>\n<p>Il me faudra donc passer comme avant avant par un <code>makefile</code></p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-makefile\"><code class=\"language-makefile\">// in makefile\n\n<span class=\"token symbol\">test-admin</span><span class=\"token punctuation\">:</span>\n\tcd services/administration &amp;&amp; NODE_ENV<span class=\"token operator\">=</span><span class=\"token string\">\"test\"</span> CI<span class=\"token operator\">=</span>true yarn test\n\n<span class=\"token symbol\">test-configurator</span><span class=\"token punctuation\">:</span>\n\tcd services/configurator &amp;&amp; NODE_ENV<span class=\"token operator\">=</span><span class=\"token string\">\"test\"</span> CI<span class=\"token operator\">=</span>true yarn test\n\n<span class=\"token symbol\">test</span><span class=\"token punctuation\">:</span> test-admin test-configurator\n</code></pre>\n      </div>\n<h3>Lerna</h3>\n<p>Avant de conclure, j'ajouterais quelques mots sur un projet cit en introduction: <a href=\"https://lernajs.io/\">Lerna</a>.<br>\nLerna est un outil qui permet principalement de <strong>partager</strong> du code au sein d'un monorepo.   </p>\n<p>Imaginons une librairie que l'on a divis un plusieures parties, avec un <em>core</em> commun et des fonctionnalites spares en packages distincts. Chaque package va dpendre du <em>core</em>.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-json\"><code class=\"language-json\">// in packages/ra-core/package.json du projet react-admin\n<span class=\"token punctuation\">{</span>\n    <span class=\"token property\">\"name\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"ra-core\"</span><span class=\"token punctuation\">,</span>\n    <span class=\"token property\">\"version\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"2.0.0-beta2\"</span><span class=\"token punctuation\">,</span>\n\t...\n<span class=\"token punctuation\">}</span>\n</code></pre>\n      </div>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-json\"><code class=\"language-json\">// in packages/react-admin/package.json du projet react-admin\n<span class=\"token punctuation\">{</span>\n    <span class=\"token property\">\"name\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"react-admin\"</span><span class=\"token punctuation\">,</span>\n    <span class=\"token property\">\"version\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"2.0.0-beta2\"</span><span class=\"token punctuation\">,</span>\n    ...\n    <span class=\"token property\">\"dependencies\"</span><span class=\"token operator\">:</span> <span class=\"token punctuation\">{</span>\n        <span class=\"token property\">\"ra-language-english\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"^2.0.0-beta2\"</span><span class=\"token punctuation\">,</span>\n        <span class=\"token property\">\"ra-core\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"^2.0.0-beta2\"</span><span class=\"token punctuation\">,</span>\n        <span class=\"token property\">\"ra-ui-materialui\"</span><span class=\"token operator\">:</span> <span class=\"token string\">\"^2.0.0-beta2\"</span>\n    <span class=\"token punctuation\">}</span>\n<span class=\"token punctuation\">}</span>\n</code></pre>\n      </div>\n<p>Maintenant, si l'on modifie le <em>core</em>, il faudrait le publier pour pouvoir le tester au sein des autres packages !<br>\nLerna va permettre d'utiliser le code du <em>core</em> prsent dans le monorepo comme un package dja publi. C'est ce que fait <code>npm link</code> mais Lerna le fait mieux, et plus simplement.</p>\n<p>Dans notre cas - celui d'un petit projet - on ne partage que des fonctionnalits entre nos diffrentes parties du dpt, pas de code ! Lerna n'a donc pas d'intrt (ou en tout cas, je ne l'ai pas vu).   </p>\n<p>Par contre, ds lors que l'on va avoir besoin d'isoler du code commun entre plusieurs de ces parties du projet, par exemple un *style guide** utilis par une appli web et une appli mobile, Lerna prendra tout son sens.</p>\n<h2>Conclusion</h2>\n<p>Lutilisation dun monorepo pour grer un projet client est une vidence quand bien mme les diffrentes parties du projet (api, front, mobile) seraient sur des technos diffrentes.</p>\n<p>Dans ce cadre et si plus dune des parties est base sur JavaScript, lutilisation des workspaces Yarn, sans apporter normment, permet de gagner de lespace disque et du temps dinstallation. Cest dj a.<br>\nDes outils plus classiques (Eslint, Jest) se prtent galement bien  ce mode de gestion du code.</p>\n<p>Les monorepos ne sont pas une rvolution donc, mais une volution positive vers une meilleure gestion de notre quotidien de dveloppeur.</p>","frontmatter":{"title":"Un monorepo pour les petits projets","date":"2018-02-21","tags":["Git","Project"],"description":"Plbiscite sur les grosses bases de code, lutilisation dun monorepo sur un projet de librairies est un indniable plus. Mais quen est-il sur les projets plus standards?"}}},"pathContext":{"slug":"monorepo"}}

